(40, 'Treasure Island', 'Treasure Island is an adventure novel by Scottish author Robert Louis Stevenson, telling a story of \"buccaneers and buried gold\". It is considered a coming-of-age story and is noted for its atmosphere, characters, and action.', 'Horror', 33, 'data:image/jpeg;base64,', 87, 'Robert Louis Stevenson', '1-4028-9462-7');
INSERT INTO `products` (`id`, `name`, `details`, `genre`, `price`, `image`, `quantity`, `author`, `isbn`) VALUES
(41, 'The Alchemist', 'The 25th Anniversary Edition of the beloved novel! Santiago, a young shepherd living in the hills of Andalucia, feels that there is more to life than his humble home and his flock. One day he finds the courage to follow his dreams into distant lands, each step galvanised by the knowledge that he is following the right path: his own. The people he meets along the way, the things he sees and the wisdom he learns are life-changing.', 'Fantasy', 12, 'data:image/jpeg;base64,', 19, 'Paulo Coelho', '1-4028-9462-7');
INSERT INTO `products` (`id`, `name`, `details`, `genre`, `price`, `image`, `quantity`, `author`, `isbn`) VALUES
(42, 'Dracula', 'When solicitor Jonathan Harker arrives in Transylvania to organise the estate of a mysterious client, his growing uneasiness quickly turns into terror. Count Dracula has something more monstrous in mind and Jonathan finds himself trapped, a prisoner in a castle of horrors. ', 'Horror', 23, 'data:image/jpeg;base64,', 68, 'Bram Stoker', '1-4028-9462-7');
INSERT INTO `products` (`id`, `name`, `details`, `genre`, `price`, `image`, `quantity`, `author`, `isbn`) VALUES
(43, 'Gone Girl', 'Who are you? What have we done to each other? These are the questions Nick Dunne finds himself asking on the morning of his fifth wedding anniversary, when his wife Amy suddenly disappears. ', 'Mystery', 12, 'data:image/jpeg;base64,', 122, 'Gillian Flynn', '1-4028-9462-7');
INSERT INTO `products` (`id`, `name`, `details`, `genre`, `price`, `image`, `quantity`, `author`, `isbn`) VALUES
(44, 'Think and Grow Rich', 'Think and Grow Rich is one of the most influential and acclaimed books on success ever published. This classic hardback edition contains the original 1937 text, complete and unabridged with an author preface. In 13 clear, simple steps, Hill explains his \"law of success\" which is the cornerstone for harnessing your potential and growing your wealth. ', 'Non-Fiction', 222, 'data:image/jpeg;base64,', 110, 'Napoleon Hill', '12312313');
INSERT INTO `products` (`id`, `name`, `details`, `genre`, `price`, `image`, `quantity`, `author`, `isbn`) VALUES
